import './Caption.css'

function Caption({ postcap, username }) {
  return (
    <div className='SelectedCaption'>
        <div className='SelectedCap'>{postcap}: Caption</div>
        <button className='SelectedViewComments'>View all</button>
    </div>
  )
}

export default Caption
